import styled from 'styled-components';

export default styled.ul`
  	width: 100%;
	list-style-type: none;
	display: flex;
	flex-flow: row-wrap;
  	justify-content: ${(props) => {
	  		switch(props) {
	  			case 'right':
	  				console.log('right');
	  				'flex-end'
	  				break;
	  			case 'left':
	  				console.log('right');
	  				'flex-start'
	  				break;
	  			case 'center':
	  				console.log('right');
	  				'space-around'
	  				break;	  				
	  			default:
	  				console.log('default');
	  		}
  		}}
`;
